import org.apache.spark.mllib.util.MLUtils;
import org.apache.spark.mllib.optimization;
import org.apache.spark.ml.classification.LogisticRegression;
import org.apache.spark.mllib.classification.LogisticRegressionWithSGD;
import org.apache.spark.mllib.optimization.SquaredL2Updater;
import org.apache.spark.mllib.evaluation.BinaryClassificationMetrics;

//We need to convert our data to LabeledPoints for training a Logistic Regression model
// TruckData(eventTime: Long, truckId: Int, driverId: Int, driverName: String,
//                                       routeId: Int, routeName: String, latitude: Double, longitude: Double,
//                                       speed: Int, eventType: String, foggy: Int, rainy: Int, windy: Int, congestionLevel: Int, isViolation: Int)

truckRDD.take(1).foreach(a => println(a))

val labeledPoints = truckRDD.map{
    truck =>
    LabeledPoint(truck.isViolation.toDouble, Vectors.dense(truck.routeId, truck.latitude, truck.longitude, truck.speed, truck.foggy, truck.rainy, truck.windy))
}

//Create a small random sample for training. This can be useful for quickly iterating over model designs
val sample = labeledPoints.sample(false, 1, System.currentTimeMillis().toInt).cache()
println(sample.count())

val splits = sample.randomSplit(Array(0.8, 0.2))
val training = splits(0).cache()
val test = splits(1).cache()

val numTraining = training.count()
val numTest = test.count()
println(s"Training: $numTraining, test: $numTest.")

val updater = new SquaredL2Updater()

    val model = {
        // val algorithm = new LogisticRegression()
        // algorithm.fit(training.toDF())
        val algorithm = new LogisticRegressionWithSGD()
        algorithm.optimizer.setNumIterations(200).setStepSize(1.0).setUpdater(updater).setRegParam(0.1)
        algorithm.run(training).clearThreshold()
     }   

    val rprediction = model.predict(test.map(_.features))
    val rpredictionAndLabel = rprediction.zip(test.map(_.label))
    val rmetrics = new BinaryClassificationMetrics(rpredictionAndLabel)

    println("\n");
    println("Route Id Weight " + model.weights(0))
    println("Latitude Weight " + model.weights(1))
    println("Longitude Weight " + model.weights(2))
    println("Speed Weight " + model.weights(3))
    println("Foggy Weight " + model.weights(4))
    println("Rainy Weight " + model.weights(5))
    println("Windy Weight " + model.weights(6))
    println("\n")
    println("Intercept " + model.intercept)
    println(s"Test areaUnderPR = ${rmetrics.areaUnderPR()}.")
    println(s"Test areaUnderROC = ${rmetrics.areaUnderROC()}.")


val valuesAndPreds = test.map { point =>
  val prediction = model.predict(point.features)
  (point.label, prediction, point.features)
}

val MSE = valuesAndPreds.map{ case(label, prediction, features) => math.pow((label - prediction), 2) }.mean()
println("training Mean Squared Error = " + MSE)
println("intercept: " + model.intercept + " weights: " + model.weights)

valuesAndPreds.take(100).foreach(println)

// Save and load model
model.save(sc, "hdfs:///tmp/trucking/models/scalaLinearRegressionWithSGDModel")

